const canvas = document.getElementById("canvas1");
const ctx = canvas.getContext("2d");
canvas.width = 800;
canvas.height = 800;

const image1 = new Image();
// image1.src = "SLASH21.png";
// image to base 64 이용, image를 pixel화
image1.src =
  "data:image/png;base64,";

// image 가 업로드되고 나면 실행할 함수
image1.addEventListener("load", function () {
  // (선택한 이미지 요소, x 좌표, y 좌표, 이미지를 넓이를 canvas 넓이에 맞춘다, 이미지 높이를 canvas 높이에 맞춘다.)
  ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);
  // ( 시작점 x 좌표, 시작점 y 좌표, 종점 x 좌표, 종점 y 좌표) 에 있는 이미지의 픽셀 정보를 가져온다.
  const scannedImage = ctx.getImageData(0, 0, canvas.width, canvas.height);
  console.log(scannedImage);
  // image 의 픽셀 정보가 r g b a 총 네개씩 저장되어있음
  const scannedData = scannedImage.data;

  // 모든 픽셀에 대한 반복 작업 설정 :
  for (let i = 0; i < scannedData.length; i += 4) {
    // grayscale : rgb 를 각각 같은 값으로 지정하면 grayscale 이 됨
    // 각 픽셀 마다 r, g, b의 총 합을 가져오고
    const total = scannedData[i] + scannedData[i + 1] + scannedData[i + 2];
    // 평균 값을 구하고
    const averageColorValue = total / 3;
    // 각각의 rgb에 평균값을 넣어줌
    scannedData[i] = averageColorValue;
    scannedData[i + 1] = averageColorValue;
    scannedData[i + 2] = averageColorValue;
  }
  // grayscaled 된 픽셀 데이터를 원래 데이터에 집어넣음
  scannedImage.data = scannedData;
  // 바뀐 데이터로 이미지를 다시 그림
  ctx.putImageData(scannedImage, 0, 0);
});
